    "description": "AIM and SHOOT!  Download now for free one of the best fps shooting games. Clash with the criminals on different scenarios.<br><br>Sniper 3D Assassin® in 7 words: great gameplay, awesome visuals and entertaining missions. And best of all? It's a free fps game to pass the time! Defend the victims from kidnappings to bomb attacks: hostage survival is critical!<br><br>Features:<br>- Ultra realistic 3D graphics and cool animations<br>- Hundreds of thrilling missions<br>- Play in multiple battlegrounds, from huge cities to beautiful beaches<br>- Tons of letal guns and mortal weapons<br>- Addicting FPS gameplay<br>- Easy and intuitive controls<br>- Free game: play it both on your phone and tablet<br><br>Forget those dumb, repetitive shooting games. Here, your duty will include racing against time, exploding helicopters, killing zombies and quite a few shots in slow motion. Survival is necessary! But can you solve the puzzle, save the victims and kill only the right target hidden in the crowd? Can you stop the unknown virus from spreading? You received the call for duty of saving the people.<br><br>The best first person shooter (fps) action game! Be the best sniper in every environment! The combat is real, and you can be the hero.<br><br>● Hundreds of missions:<br>\"Alpha, Bravo, Charlie, do you copy?\" Find the target, aim, shoot. <br>Save the state secrets from the rogue agents and spies, and stop them from spreading a terrible virus. Do you have the skills? Help your country in the massive nuclear competition.<br><br>● The hostages are within the enemy fort. Will you storm in through the open, or sneak up at nite? <br><br>● The enemy is racing to their target: don't let them reach it in time! <br><br>● Don't leave any zombies alive!! Are you prepared for all the action and adventure in this awesome fps shooting game? Can you guarantee the survival of the human race?<br><br>● Unlock awesome weapons and upgrade them with evolutions in the arsenal:<br>Buy the best Sniper rifles, assault rifles, shotguns or pistols that exist with the gems you earned in the game! Upgrade the ammo, the grip, and the calibre to get bullets that inflict more damage, have better range, scope, stability, or zoom. Will you choose the hunting rifle, the awesome assault mp5, a Glock or a Colt in the armory?<br><br>● Play it anywhere<br>Sniper 3D does not require you to be always online in order to have fun. You can enjoy it offline in the subway, while flying on a (real) plane, in the car on the road. From time to time, it may be necessary to download additional (free) content online.<br><br>● PvP mode<br>Try out the pvp mode: prepare your gun and hunt your enemy. The pvp mode will test your speed in killing and hunting. Take long and you will be dead. Follow the rules of your training and act! You can now join up with other players from around the world.<br><br>● Limited data usage<br>Our game will not consume tons of data from your mobile plan that you'd want to use instead to surf the web, watch youtube videos and listen to free music. Have fun with limited data usage.<br><br>● Disclaimer<br>Sniper 3D Assassin® is a free game but it contains mature content and optional in-app purchases for real money. You may want to keep away it from your kids and younger boys<br><br>Sniper 3D Assassin® is brought to you by Fun Games For Free.",
