    "description": "The time to take action and strike back is now! <br>We’re calling for the best sniper in the world to take aim at evil, wherever it hides. There’s no room for remorse, so shoot to kill…<br><br>THE MOST STUNNING OF ALL SNIPER SHOOTING GAMES<br>• Unbelievable 3D sniper graphics that probably make this the best game for FPS gun fun.<br>• This isn’t one of those ordinary gun games. You’ll use your 3D sniper shooting game skills against soldiers, vehicles & more!<br>• “Bullet time” effects that blow all other FPS gun games away. Watch your amazing sniper shots from your top games.<br>• Weather effects unlike those in any other shooting game around.<br><br>MODERN & FUTURE FPS FIREPOWER<br>• Take your gun game to the next level as you shoot 3D sniper rifles, railguns and more.<br>• Upgrade your battlefield arsenal to strike fast and hard at the heart of evil!<br>• Custom options make your best games even better.<br><br>PVP MULTIPLAYER BATTLEFIELD<br>• Steal resources from players in this PvP Multiplayer shooting game.<br>• Build a strong shooter squad in what is probably the best game in its category.<br><br>EASY TO PLAY, TOUGH TO MASTER<br>• Like all the best games, Sniper Fury rewards you for joining these free and action-packed events in this gun game.<br>• Connect to our FPS community for content, contests, rewards & more top games!<br><br>TAKE AIM AT THE BEST FPS LEAGUES <br>• Earn a high enough score and aim to enter the top game league and unlock the best rewards! <br>• Be the best assassin there is in this shooting game where only the best of the best reach the top.<br><br>CLANS <br>• Join a 3D sniper Clan with other top game players.<br>• Trade, chat & share tips with your Clanmates to strengthen your fellow assassin shooters.<br>• Establish a home base for your 3D sniper Clan to unlock battlefield perks!<br>• CLAN WAR: The best games are those where Clanmates become friends.<br><br>GEAR SETS: As you play your gun games, collect shooter gear to unlock unique powers to strike back at opponents. <br>PROTOTYPE WEAPONS: Rush the battlefield with the latest, most state-of-the-art hitman / assassin tools you could ask for in any shooting game.<br>IMPROVED BULLET SKINS: Try the new bullet skins to kill your opponents in style in one of the top games around!<br>CLAN LEADERBOARDS: Check your Clan’s FPS victories and shoot to the top to win your gun games!<br><br>This is probably the best game for fans of FPS action, shooting games, gun games, being a hitman, an assassin, launching a furious strike on the battlefield, war, and any of the top games for free multiplayer fun!<br>The most amazing of all 3D sniper FPS shooting games. So don't forget to rate us as one of the best games on the Play Store.<br><br>You can download and play this game for free. Please be informed that it also allows you to play using virtual currency, which can be acquired as you progress through the game, or by deciding to watch certain advertisements, or by paying with real money. Purchases of virtual currency using real money are performed using a credit card, or other form of payment associated with your account, and are activated when you input your Google Play account password, without the need to re-enter your credit card number or PIN. <br>In-app purchases can be restricted by adjusting the authentication settings within your Play Store settings (Google Play Store Home > Settings > Require authentication for purchases) and setting up a password for each purchase / Every 30 minutes or Never.<br><br>Find out more about the game -- http://www.sniperfury.com/<br><br>__<br><br>Visit our official site at http://gmlft.co/website_EN<br>Check out the new blog at http://gmlft.co/central<br><br>Don't forget to follow us on social media:<br>Facebook: http://gmlft.co/Sniper_Facebook<br>Twitter: http://gmlft.co/Sniper_Insta<br>Instagram: http://gmlft.co/GL_SNS_IG<br>YouTube: http://gmlft.co/SniperFury_YouTube<br>Forum: http://gmlft.co/SniperFury_Forum<br><br>Terms of Use: http://www.gameloft.com/en/conditions-of-use<br>Privacy Policy: http://www.gameloft.com/en/privacy-notice<br>End-User License Agreement: http://www.gameloft.com/en/eula",
