    "description": "Sniper! Enter the arena and become the #1 SHARPSHOOTER in this thrilling ‘sniper vs. sniper’ LIVE COMBAT game! Compete against more than 500K SNIPERS worldwide, climb the leaderboard, and ENJOY EVERY BATTLE in this premier mobile experience! Feel the pure adrenaline rush, and lifelike combat emotions in the heat of the battlefield, right in your hands on your mobile screen. Jump into the action and join the battle right away, it’s FREE TO PLAY!<br><br>• Enjoy breathtaking 3D GRAPHICS: the world’s best SNIPER RIFLES, superbly realistic and authentic in every little detail, and 4 spectacular combat locations with authentic sniper firing positions, beautifully designed in terms of game logic and the balance.<br><br>• Try intuitively easy controls - SWIPE, ZOOM, SHOOT! Compete in 3 game modes: Deathmatch, Team Deathmatch, and Domination with up to 8 real opponents on the map, whoever shoots the most enemies wins the round.<br><br>• Develop your SNIPER CAREER, from recruit all the way to the rank of Phantom, with a variety of daily tasks and a detailed ranking system. Unlock and upgrade modern PROFESSIONAL EQUIPMENT: sniper rifles, ammunition, camouflage and special equipment.<br><br>• Ally with your friends and create an UNSTOPPABLE SQUAD! Lead them to the top of the leaderboard, defeat other teams and win territories in Domination mode.<br><br>This game requires stable INTERNET CONNECTION to play. The gameplay involves real-time online match ups with players across the globe, shared server for any mobile device, and LIVE-CHAT.<br><br>For more info and all the latest news check out: https://www.facebook.com/SniperArenaGame/",
