    "description": "<b>New York City is the epicenter of a terrifying zombie apocalypse in this multi-award winning first person shooter. Choose one of five unique characters and join the elite team known as the Wolfpack, a task force assigned to combat the walking dead threat and discover the secret behind the cataclysmic plague. Take time out from killing zombies to challenge your friends in online PvP multiplayer battles. Good thing you brought plenty of bullets!</b><br><br><i>“Big, silly, violent fun.”</i> - <a href=\"http://www.google.com/url?q=http%3A%2F%2Fwww.pocketgamer.co.uk%2Fr%2FiPad%2FUnkilled%2Freview.asp%3Fc%3D67312&sa=D&sntz=1&usg=AFQjCNHvYTf7J1kW9RKjzDHxAjhjMerbxA\">PocketGamer.co.uk</a><br><i>“Luscious graphics and intense action.”</i> - <a href=\"http://www.google.com/url?q=http%3A%2F%2Fwww.androidauthority.com%2Funkilled-impressions-e3-2015-618232%2F&sa=D&sntz=1&usg=AFQjCNGiWMLj8fD5agnuHXCnRq8k7XgSgw\">AndroidAuthority.com</a><br><br><b><u>THRILLING SOLO COMBAT MISSIONS. ONLINE PVP MULTIPLAYER. TONS OF UNIQUE GUNS.</u></b><br>• The final frontier in the war between the living and the undead! Fight for survival <b>over 150 missions</b> with an epic storyline. Target <b>unique enemies and bosses</b>, including SHERIFF, DODGER, MINESWEEPER, BUTCHER and more.<br>• Take on players from all over the world with <b>first person PvP multiplayer</b>. Or build your own zombie army in Skirmish Ops and go to war against other player’s bases with your undead horde!<br>• <b>More than 40 weapons in five classes</b>, featuring the LSAT machine gun, SAIGA-12K shotgun, and the M24 sniper rifle. Just don’t run out of bullets...<br>• <b>Loads of skins</b> are ready for you <b>to customise your character and guns</b>. Be the best dressed killing machine in the zombie apocalypse!<br><br><b><u>RIDICULOUSLY INSANE GRAPHICS</u></b><br>At MADFINGER Games we push the frontier of what is possible on mobile devices! UNKILLED is a feast for your eyes, with post-process effects to create an <b>immersive cinematic experience</b>. There’s high resolution, real-time soft shadows and high-polygon character models, and don’t even get us started on our SpeedTree vegetation rendering! Not to mention shooting zombies in the face results in lovingly rendered gore...<br><br><b><u>SMOOTH FIRST PERSON SHOOTER ACTION!</u></b><br>• Our unique MADFINGER Games control system for mobile devices is approved by millions of players worldwide. <b>Support for a wide range of gamepads</b>.<br>• Intuitive gameplay. Our autofire shooting system lets you focus on your survival.<br>• Experience the new Adrenaline feature and put your aim to the test. Target as many undead domes as possible!<br><br><b><u>FEATURES</u></b><br>• <b>Design your hero</b> for PvP with customisable skills and loadouts, then combat real opponents in <b>five distinctive environments</b>.<br>• <b>Become the Champion in ranked duels and leagues</b>. Earn “intel” by winning PvP matches, levelling up your hero with a huge skill tree.<br>• Accept challenges and earn multiple rewards: VIP chests, gold, gadgets, money…<br><br>__________________________________________<br><br>Don’t forget to follow us on social media:<br>Facebook: <a href=\"https://www.google.com/url?q=https%3A%2F%2Fwww.facebook.com%2Funkilled&sa=D&sntz=1&usg=AFQjCNG3tZKQQoJ2GmJyBK23Rdi2G9BFyA\">facebook.com/unkilled</a><br>Twitter: <a href=\"https://www.google.com/url?q=https%3A%2F%2Fwww.twitter.com%2Fmadfingergames&sa=D&sntz=1&usg=AFQjCNE0G69Hvs9IvqBbwGbKQzDX-zU2LA\">twitter.com/madfingergames</a><br>YouTube: <a href=\"https://www.youtube.com/madfingergames\">youtube.com/madfingergames</a><br>Twitch: <a href=\"https://www.google.com/url?q=https%3A%2F%2Fwww.twitch.tv%2Fmadfingergames&sa=D&sntz=1&usg=AFQjCNG4Uvw72mLMAAQOfl5BGDVtjBBKxQ\">twitch.tv/madfingergames</a><br><br>Got a question? Check <a href=\"https://www.google.com/url?q=https%3A%2F%2Fwww.madfingergames.com%2Fsupport&sa=D&sntz=1&usg=AFQjCNECXLq--wdO7pJ7VGFD_iyra9vJwg\">madfingergames.com/support</a>",
