    "description": "<strong><font color=\"blue\"> Modern Strike Online: First Person Shooter! </font></strong><br>Are you a fan of the good FPS shooting games? Looking for a S.W.A.T. vs Terrorists killing games? <br>Here is some news for you. We are ready to change an idea of free online pvp Android multiplayer shooters. Jaw-dropping graphics and optimization even for low-performing devices. <br>Take the part in the vanguard at the battlefield of Modern Strike Online killing games genre game! <br>Confront your enemy – it’s high-time to blitz shooter!<br><br><strong>Game features: </strong><br>✪ 8 battle modes for a single and team fight like gun games!<br>✪ Clans!<br>✪ Custom games that you create by your own rules!<br>✪ 14 maps to try different tactics and find your enemy’s weak spots!<br>✪ 70 types of weapons: guns, pistols, snipers, tommy-guns, shotgun, grenades, rockets and body armors!<br>✪ Weapon Skins!<br>✪ Perfect optimization even for weak devices!<br>✪ Beautiful graphics!<br>✪ Easy and intuitive control!<br><br><strong>Game modes: </strong><br>✪ <strong>Team Deathmatch: </strong><br>Teams battle against each other. The mission is to destroy opposing team and show who is the best player in pvp first person shooter!<br><br>✪ <strong>Deathmatch</strong><br>It's kill or be killed, capitalism style. Kill the other players as many times as you can. Making a headshot is the best way to win;<br><br>✪<strong>Team DM with a bomb</strong><br>One team becomes Counter-Terrorists and other team becomes Terrorists. One of the team should to plant a bomb and other team should to defuse it;<br><br>✪<strong>Team Duel mode</strong><br>1x1 battle for the winning end!<br><br>✪ <strong>Team Squad</strong><br>Two teams fight against each other only with 1 hp;<br><br>✪ <strong>Hardcore mode</strong><br>Action realistic mode. Taken damage is increased x3 times;<br><br>✪ <strong>Custom games</strong><br>Create your own rules soldier. Call your friends. Create lobby and play with your squads in the best military games!<br><br><strong>*Reminder</strong>: Join tournaments to win prize, raise your clan!<br><br><strong>More shooter features: </strong><br>✯✯✯ <strong>Login to Get Daily Free Gifts</strong> ✯✯✯<br>Login to Get Daily Free Gifts, Login to get Free Daily Quests!<br>Login to get daily free items. Don’t also miss the bonus EXP and Credits time!<br>　<br>✯✯✯ <strong>70+ Weapons, Customize Your Exclusive Weapons and Skins! </strong> ✯✯✯<br>70 types of weapons: guns, pistols, tommy-guns, shotgun, grenades, rockets and body armors!<br>Customize your weapon and get a unique test piece – change the color and get all options, from barrels and stocks to scopes.<br><br>✯✯✯ <strong>Upgrade gear system</strong> ✯✯✯<br>Upgrade your gear and become stronger in gun games!<br>Claim first place and give a headshot to the one who will dare to contest the air!<br><br>Regular updates and new elements are waiting for you in online multiplayer shooting games. This year’s best graphics and perfectly matched sounds will make you spend your time playing Modern Strike Online!<br><br>=================================<br>Join!<br>Facebook: https://www.facebook.com/modernstrikeofficial<br>YouTube: https://www.youtube.com/channel/UChMfgo6g8ri0FaAR-SpYpXw<br>Support: support@ll-games.com",
