    "description": "Join Alto and his friends as they embark on an endless snowboarding odyssey. Journey across the beautiful alpine hills of their native wilderness, through neighbouring villages, ancient woodlands, and long-abandoned ruins.<br><br>Along the way you'll rescue runaway llamas, grind rooftops, leap over terrifying chasms and outwit the mountain elders – all while braving the ever changing elements and passage of time upon the mountain.<br><br>Features:<br><br>• Fluid, graceful and exhilarating physics-based gameplay<br><br>• Procedurally generated terrain based on real-world snowboarding<br><br>• Fully dynamic lighting and weather effects, including thunderstorms, blizzards, fog, rainbows, shooting stars, and more<br><br>• Easy to learn, difficult to master one button trick system<br><br>• Chain together combos to maximize points and speed<br><br>• Test your skills with 180 handcrafted goals<br><br>• Discover six unique snowboarders, each with their own special attributes and abilities<br><br>• Challenge your friends. Compete for best high score, best distance, and best trick combo!<br><br>• Acquire the wingsuit from Izel’s workshop for an entirely new gameplay dynamic<br><br>• Beautifully minimalist and evocative visual design<br><br>• Original music and handcrafted audio for an ambient and immersive experience (headphones recommended!)<br><br>Reviews:<br><br>\"A piece of interactive art\"<br>– WIRED<br><br>\"One of the best mobile games\"<br>– The Verge<br><br>\"Alto's Adventure demands your attention\"<br>– IGN<br><br>\"Best Looking Video Games of 2015\"<br>– TIME",
