    "description": "We’ve teamed up with Google Play to help you build up your ultimate team of Champions! From now through to August 31, 2018, you’ll receive special Crystals and energy refills when you purchase a Google Play Gift Card at select retailers!  For details, read more now at playcontestofchampions.com/google-play-gift-card<br><br>Prepare for epic versus-fighting action with your favorite Marvel Super Heroes & Super Villains in the ultimate cosmic showdown! Spider-Man, Iron Man, Wolverine & more await your summons to battle! Assemble a team & begin your quest to become the Ultimate Marvel Champion!<br><br>WELCOME TO THE CONTEST:<br>Captain America vs. Iron Man! Hulk vs. Wolverine! Spider-Man vs. Deadpool! The greatest battles in Marvel history are in your hands! The greedy Elder of the Universe known as The Collector has summoned you to a brawl of epic proportions against a line-up of vile villains including Thanos, Kang the Conqueror, and many more! Experience the ultimate free-to-play fighting game on your mobile device…Marvel Contest of Champions!<br> <br>SUIT UP WITH FRIENDS:<br>• Team up with your friends and other Summoners to build the strongest Alliance<br>• Strategize with your alliance, help them keep their Champions in the fight<br>• Battle to the top in Alliance Events and take on Alliance Quest Series together in specially designed quest maps to earn exclusive Alliance rewards<br>• Test your Alliance’s mettle by battling it out with Alliances from around the world in Alliance Wars!<br> <br>BUILD YOUR ULTIMATE TEAM OF CHAMPIONS:<br>• Assemble a mighty team of heroes and villains (choosing Champions such as: Iron Man, Hulk, Wolverine, Storm, Star-Lord, Gamora, Spider-Man, Deadpool, Magneto and Winter Soldier)<br>• Embark on quests to defeat Kang and Thanos and face the challenge of a mysterious new super powerful cosmic competitor, ultimately to prevent the total destruction of The Marvel Universe<br>• Improve your team’s offense and defense with multiple Mastery trees<br> <br>COLLECT THE MIGHTIEST SUPER HEROES (AND VILLAINS!):<br>• Collect, level up, and manage your teams of heroes and villains wisely to receive synergy bonuses based upon team affiliation and relationships taken from the pages of Marvel Comics<br>• Pairing up Black Panther and Storm or Cyclops and Wolverine for bonuses, or making a team of Guardians of the Galaxy for a team affiliation bonus<br>• The more powerful the Champion, the better their stats, abilities and special moves will be<br>• New Champions are being added to The Contest all the time!<br> <br>QUEST AND BATTLE:<br>• Journey through an exciting storyline in classic Marvel storytelling fashion<br>• Fight it out with a huge array of heroes and villains in iconic locations spanning the Marvel Universe such as: Avengers Tower, Oscorp, The Kyln, Wakanda, The Savage Land, Asgard, the S.H.I.E.L.D. Helicarrier, and more!<br>• Explore dynamic quest maps and engage in a healthy dose of action-packed fighting utilizing controls developed specifically for the mobile platform<br> <br>Like us on Facebook: www.facebook.com/MarvelContestofChampions<br>Subscribe on YouTube: www.youtube.com/MarvelChampions<br>Follow us on Twitter: www.twitter.com/MarvelChampions<br>Follow us on Instagram: www.instagram.com/marvelchampions<br>www.playcontestofchampions.com",
