    "description": "***Best Robot Fighting Game on Mobile!*** <br>Join more than 10 Million Robot Fighters Online!<br>Like robots, battlebots, robot fighting games? Then Iron Kill: Robot Games is for you! <br><br><br>FEATURES <br>☆ Own & fight 35 unique battle robots & battle mechs<br>☆ PvP multiplayer robot fights with real players worldwide <br>☆ Unleash devastating combos, abilities and special moves <br>☆ Upgrade, research and equip boosts to dominate fights <br>☆ Fight in Championship Leagues, Restricted Fights and Limited Time Events <br>☆ Stunning high quality graphics and animations <br>☆ Compete against your Facebook Friends in Leagues <br><br>COLLECT YOUR MIGHTIEST BATTLE HEROES<br> Build your legendary fighters from 35 mean metal machines, fighting robots and dominate in the contest through a post-apocalyptic world. <br><br>UNLEASH REAL DEVASTATING MOVES <br>Start your robot boxing fight using quick attacks to stay agile or heavy attacks to go strong. Perform a wide range of boxing & fighting tactics along with unique abilities like stun, critical strike, shock shield…etc. during fights to turn the odds in your favour. Fill your revenge meter and unleash the superpower of your boxing robot made of steel. Unleash your combat skills to dominate in the real fight of champions! <br><br>UPGRADE, RESEARCH & EQUIP BOOSTS <br>Win and upgrade your battlebots to enhance their steel and attack skills. Equip them with Boosts to double their power in the fights. Perform research tactically to enhance your bots and accelerate your overall journey. <br><br>LEAGUE ROBOT BATTLES, RESTRICTED FIGHTS AND LIMITED TIME EVENTS <br>Combat through 60 league fights challenging 12 unique champions to win the Ultimate Iron Kill Championship! Complete restriction events to win special Pro edition steel made boxing robots. Participate in limited time events to win cool in-game rewards. <br><br>STUNNING 3D GRAPHICS <br>Immerse yourself in 7 flawless real looking arenas designed to hold the deadly robot wars between 35 real robots. <br><br>ENGAGING SOCIAL FEATURES <br>Compete against players worldwide on the journey to become Bot Fight Club Champion! Brag about your wins to win cool in-game rewards. Challenge your friends in completing achievements. Download and start fighting! <br><br>Build the ultimate immortals and kill everything that stands in your way to dominate the bot fighting championship, Ironkill! <br><br>A network connection is required to play. Having problems? Any suggestions? <br>You can reach us at support@playmotion.sg.",
