    "description": "STAR ROBOTS ARE HERE! <br>Fight the greatest ranked robot brawlers among 100 million WRB players in exciting Global Multiplayer battles. Transform the legends Atom, Zeus, and all-time favorite champions into powerful 1, 2, 3 and 4 Star Robots to win big in Versus Leagues & Global Tournaments. Top the Leaderboards, claim the Championship title and reign supreme as the Ultimate World Robot Boxing Champion.<br><br>Achieve greatness in the future of boxing, where gigantic robots pack powerful punches. Unleash your fighting style with deadly jabs, uppercuts & special moves to win world championship belts, collect trophies & knockout friends!<br><br>UNLEASH ROBOT TITANS <br>Towering over 9 feet tall and weighing over 2000 pounds are your 58 ultimate fighting machines, robot titans & legends including fan favorite superstars – Zeus, Atom, Noisy boy & Twin Cities.<br><br>BRAWL REAL-TIME WITH FRIENDS <br>Unleash your true self in live local Wi-Fi & Bluetooth multiplayer and earn bragging rights while enjoying the winning moment!<br><br>WIN EXCITING CHALLENGES!<br>Play Career, Multiplayer and the new Winner Takes All Mode to become the All-Category Champion.<br><br>EXPERIENCE REAL SPORTS ACTION<br>Build a roster of your favorite sport robots and take on the Legends in enthralling arenas and stadiums.<br><br>UPGRADE & COLOR YOUR CHAMPION<br>Fight and Upgrade your robot to be stronger, faster and meaner. Color your robot, express yourself and have some fun in the Paint shop!<br><br>SHOWCASE YOUR TRIUMPHS<br>Win Challenges and exhibit your achievements in an all new Trophy Room.<br><br>ACHIEVE GLORY IN ARENAS<br>Reign supreme in 11 huge arenas that can barely contain these hulking mean machines.<br><br>RELIVE THE INSPIRING MOVIE<br>Play the official boxing game of the blockbuster movie Real Steel. Take your robot champion from the movie for amazing title winning experiences in this smash hit sequel.<br><br>JOIN THE ELITE CLUB OF REAL STEEL FANS<br>Enjoy regular news on game updates, robots, features, views, video tips and more for Free<br><br>Like us on Facebook: https://www.facebook.com/RealSteelWorldRobotBoxing<br>Follow us on Twitter: https://twitter.com/realsteelgames/<br>Capture player moments on Instagram: https://instagram.com/realsteelgames/<br><br>The game is also optimized for tablet devices<br><br>This game is completely free to download and play. However, some game power-ups can be purchased with real money within the game. You can restrict in-app purchases in your store’s settings.<br><br>* Permission:<br>STORAGE: for saving the data and progression.",
