    "description": "The special ops shooting madness and third person shooter that’ll make you forget any other AAA FPS combat! Feel the adrenaline thrills of combat action and counterattack fighting in this MMORPG and become a real sniper of the special forces! Get ready for the war action with your gun and join now this multiplayer FPS shooting battle. Have you chosen your MP5 shooter weapon? Shoot, counterattack and respawn!<br><br>Join this third person shooter and MMORPG counterattack adventure! Play this shooting game offline or online for FREE: Complete challenges, join a special forces squad, counterattack or just play with your gun! <br>Become whoever you want: thumper gun man, sniper, special ops soldier, shooting target expert, rifleman, marksman, war veteran or just a combat soldier in this online third person shooter full of multiplayer shooter war action! Choose your weapon in the ammo arsenal: gadgets, shotguns, rifles, firearms, thumper gun, MP5 machine guns… Join different special ops troops teams and define your military strategy and tactics for the action FPS fight to defeat the rifleman rivals attack and counterattack of the opponent armies in the battlefield! <br><br>OFFLINE THUMPER MISSIONS:<br>- More than 185 single military troops action quests. Choose your rifleman shooter!<br>- Test all the weapons in your ammo inventory and plan the counterattack offensive in these multiplayer shooter pvp games!<br>- Action FPS battle combat!<br>- Practice your FPS strategy offline to defeat your enemy on the online pvp games!<br><br>ONLINE SHOOTER, MULTIPLAYER BATTLE SIMULATOR AND THIRD PERSON SHOOTER:<br>- Special forces and thumper war matchmaking AAA MMORPG<br>- Two shooting combat RPG modes: Free for All & Team VS <br>- Play with allied teammates on a war action struggle with a single goal: The survival of your special ops army!<br><br>CUSTOMIZE YOUR RIFLEMAN WAR HERO AND SPECIAL OPS MILITARY TROOPS WEAPONS:<br>- 60+ customization fight items with action FPS, special ops, rifleman and sniper attributes<br>- 30+ special ops weapons to attack and counterattack: Choose your guns, equip a grenade, use a hunting rifle, a MP5 machine gun, a thumper gun or any other military gun! <br>- MMORPG war action<br>- Fighting boosters and rifleman war gadgets<br>- Sniper fight battle maps in single first person action games or multiplayer shooter mode<br><br>MILITARY SPECIAL OPS COMBAT MMORPG FEATURES!<br>- Quality 3D action third person shooter combat style<br>- Smooth FPS MMORPG controls <br>- PVP games: In-Game multiplayer shooter and rifleman counterattack achievements <br>- Struggle with Facebook friends and allies<br><br>If you love military RPG shooter and third person shooter multiplayer combat games, this action FPS MMORPG will make you forget about any other online shooter, FPS defense, PVP, rifleman shooter or sniper war action games you played before! Assassin, terrorist, gunman, elite sniper, war veteran, thumper gun man or just a special forces killer… Make your special forces sniper or gunner aim at the shooting target and, with your favorite rifle or thumper gun, prepare the assault and attack with the fire of the bullets of your weapon to damage the rival rifleman or sniper in this fighting MMORPG FPS!<br>Choose your special forces and mark your target in the battle of this shooting war. Start shooting in this third person shooter multiplayer online!<br><br>Please note:<br>These third person shooter pvp games are free to play, but extra content can be purchased with real money. To restrict in-app purchases, adjust the settings on your device.<br><br>Celebrate Spring with our limited-time offers<br><br>Facebook: https://www.facebook.com/TheRespawnables<br>Twitter: https://twitter.com/TheRespawnables",
