    "description": "Your swamp is under attack! Grab a weapon and defend your home from the invading monsters, like crazed zombie-style monsters, crocodiles, aliens and more!<br><br>Come up with a strategy! Shoot weapons. Beat the monsters. Survive the attack and secure your home. The evil monsters may know no mercy, but you can beat them all – every single monster is a fun challenge!<br><br>We’ve got dynamite, flamethrowers, crossbows, blob-throwers, molotov cocktails, and more for you to use against the zombie-style critters! So get ready to SHOOT! Prepare your ATTACK! And PROTECT your home as you play the best action-packed shooter game around!<br><br><br>★★★ARE YOU READY TO COME UP WITH THE BEST STRATEGY TO BEAT THE MONSTERS?★★★<br><br>- Shoot with different guns by TAPPING THE SCREEN.<br>- DRAG AND DROP the explosives onto the monsters.<br>- Don’t miss a beat – SWITCH between weapons during the action!<br>- UPGRADE and equip yourself with guns and bombs before starting a new level.<br>- Drink a potion to CONTINUE PLAYING if you get killed, or to instantly top up your energy.<br><br>Just like players defend their towers in the best tower defense games, you have to defend your home and your swamp!<br><br>Play this action-packed, super cool tower defense game and have fun for free! Try out the Challenge mode and test your limits! When you win, you can have even more fun attempting the even more challenging multiplayer mode!<br><br>So, are you ready to play one of the most exciting games out there?!<br><br>8 action-packed EPISODES!<br>390 fun SINGLE-PLAYER LEVELS!<br>40 cool MULTIPLAYER LEVELS!<br>QUICK MISSIONS for instant excitement!<br>More than 30 awesome DEFENSE TOOLS like the mighty shotgun, the reckless minigun, and the super atom bomb.<br>More than 45 different MONSTERS running wild, each with their own special attacks!<br><br>DOWNLOAD NOW & PLAY!<br><br>Swamp Attack is a free game, with the option to purchase items to help you progress through the levels faster.<br><br>This app contains:<br>- Promotion of Outfit7's products and contextual advertising;<br>- Links that direct customers to our websites and other Outfit7 apps;<br>- The option to make in-app purchases;<br>- The option to invite Facebook friends for in-game rewards; and<br>- The option to play against other users.<br><br>Terms of use: http://outfit7.com/eula/<br>Privacy policy: http://outfit7.com/privacy-policy/<br>Customer support: support@outfit7.com",
