    "description": "Fly and survive through the 🏆 <b>Game of the Year</b>  -winning action adventure BADLAND.<br>More than <b>50 MILLION</b> players and counting!<br><br>★ 5/5 - AppSmile<br>★ 4/4 - Slide to Play<br>★ 5/5 - AppSpy<br>★ 9.2/10 - Multiplayer.it <br>★ 9/10 - Destructoid<br>★ 4.5/5 - TouchArcade<br><br>\"BADLAND is one of the most beautiful games on Android and one of the must download games of 2013.\" -- <i>Android Authority</i><br>“BADLAND is a standout game that we can’t stop playing.” -- <i>AppSmile</i><br>“BADLAND’s unique gameplay and atmosphere make it a must-download.” -- <i>Slide to Play</i><br>“BADLAND doesn’t simply look pretty, it’s an absolute treat to play” -- <i>AppSpy</i><br>“A hallmark of excellence.” -- <i>Destructoid</i><br><br>🏆  Outstanding Mobile Game <i>-- Satellite Awards 2014</i><br>🏆  Grand Prix <i>-- the International Mobile Gaming Awards 2014</i><br>🏆  Nordic Indie Sensation Award <i>-- Nordic Game 2013</i><br>🏆  Apple Design Award 2013<br>🏆  Apple iPad Game of the Year 2013<br><br><b>OVERVIEW</b><br>BADLAND is an award-winning atmospheric side-scrolling action adventure platformer set in a gorgeous forest full of various inhabitants, trees and flowers. Although the forest appears to be right out of a beautiful fairy tale, there’s something terribly wrong. The player controls one of the forest dwellers to find out what’s going on, and discovers an astonishing number of imaginative traps and obstacles on the way. <br><br>BADLAND takes side-scrollers to the next level with its innovative physics-based gameplay combined with stunning, atmospheric graphics and audio. <br><br>BADLAND also features a highly original local multiplayer mode for up to four players on the same device, where the name of the game is survival of the fittest with no rules. It’s totally OK to push your rivals in front of spinning circular saws to survive. Or, if that's too rough for you, you can also cooperate with your friends and play the modified single player campaign with up to four players. <br><br><b>FEATURES</b><br>• SINGLE PLAYER campaign with 100 truly unique levels and more coming in updates<br>• MULTIPLAYER mode for up to four players on the same device in 23 levels and more content in future updates<br>• COOPERATIVE mode for up to four players - Survive the modified single player campaign with your friends <br>• LEVEL EDITOR: Create levels, share & play!<br>• LEVEL WORLD: New levels to play all the time<br>• Intuitive one-touch controls combined with innovative level design<br>• Full support for game controllers 🎮<br>• Highly immersive audio-visual gaming experience<br>• Designed for Android phones, tablets and Android TV<br>• Supports Cloud Save and Immersive mode<br>• More levels and content coming in updates<br><br>Now featured on NVIDIA TegraZone. Plays great with full controller support 🎮  on NVIDIA SHIELD Portable and SHIELD Tablet, and Android TV.<br><br><b>Follow us</b><br>Facebook - <a href=\"http://www.google.com/url?q=http%3A%2F%2Fwww.facebook.com%2Fbadlandgame&sa=D&sntz=1&usg=AFQjCNFyKZ0nmsNRlCzC2t90SmkEkNxJVg\">http://www.facebook.com/badlandgame</a> <br>Twitter - <a href=\"http://www.google.com/url?q=http%3A%2F%2Fwww.twitter.com%2Fbadlandgame&sa=D&sntz=1&usg=AFQjCNFqJOjideuiNBOz0oEE4-Jem2dv-A\">http://www.twitter.com/badlandgame</a> <br>Blog / www - <a href=\"http://www.google.com/url?q=http%3A%2F%2Fwww.badlandgame.com&sa=D&sntz=1&usg=AFQjCNGjvasVHDcZvA0lSmZlXgPn7L6cTg\">http://www.badlandgame.com</a> <br>BADLAND Forum - <a href=\"http://www.google.com/url?q=http%3A%2F%2Fforum.badlandgame.com%2Findex.php&sa=D&sntz=1&usg=AFQjCNFZA6nQTajWK8fzPEeKIC-Q9jq_fg\">http://forum.badlandgame.com/index.php</a>",
