    "description": "Play the world’s best bird flinging, pig popping game!<br><br>Use the slingshot to fling birds at the piggies’ towers and bring them crashing down – all to save the precious eggs.<br><br>New to the world of Angry Birds? Angry Birds 2 is the best way to get to know all of the iconic characters and experience the fun gameplay that has captured the hearts (and spare time) of millions of players.<br><br>Decorated Angry Birds veteran? Everything you love about classic Angry Birds games is here with some awesome new additions. Choose which bird to fling when, play with friends, take on multi stage levels, and compete and collaborate with players around the globe.<br><br>Features:<br>● CHOOSE YOUR BIRD. Choose which bird to put in the slingshot and defeat the pigs with strategy!  <br>● MULTI-STAGE LEVELS. Play fun, challenging levels with multiple stages – just watch out for those Boss Pigs!  <br>● DAILY CHALLENGES. Have a minute? Complete a daily challenge and earn some quick rewards.  <br>● LEVEL UP your birds with feathers and up their scoring power. Build the ultimate flock!   <br>● JOIN A CLAN to take down the pigs with friends and players around the world.  <br>● IMPRESS THE MIGHTY EAGLE in Mighty Eagle’s Bootcamp and earn coins to use in his exclusive shop.  <br>● COMPETE in the ARENA. Compete with other players for some friendly bird flinging fun and prove who is the best.  <br>● COLLECT SILLY HATS. Collect hats with different fun themes and level up your birds’ fashion game.  ● BAD PIGGIES. The green baddies are back, stronger, badder, and even greener.  <br>● LOTS OF LEVELS. Play hundreds of levels with more added in regular updates and limited time events.  <br>● LEADERBOARDS. Prove who is the best in the world on the global leaderboards.  <br>● FREE to download!    ---    Angry Birds 2 is completely free to play. Although Angry Birds 2 can be downloaded for free, there are optional in-app purchases available.<br><br><br>This game may include:  <br>- Direct links to social networking websites that are intended for an audience over the age of 13.  <br>- Direct links to the internet that can take players away from the game with the potential to browse to any web page  <br>- Advertising of Rovio products and also products from third parties<br><br>This game may require internet connectivity and subsequent data transfer charges may apply. When the game is played for the first time, there is a one-off download of additional content.<br><br>Terms of Use: http://www.rovio.com/terms-of-service<br>Privacy Policy: http://www.rovio.com/privacy",
