    "description": "From the creators of Angry Birds: a game from the PIGS’ point of view! OiNk! Build makeshift contraptions from a huge collection of parts and make it to the goal without blowing your vehicle to pieces!<br><br>IGN's \"Best Mobile Game of 2012\" Winner!<br><br>\"Extremely fun and very challenging\" -- Kotaku<br><br>“The best title Rovio has released yet” - IGN<br><br>“4/4 - Must Have” -- Slide to Play<br><br>\"If you can’t enjoy watching a pig drive a badly constructed car off a cliff and onto a pile of dynamite, you probably don’t have a soul.\" - Yahoo/BGR<br><br>Create the ultimate flying/crawling/rolling/spinning/crashing device and pilot the pigs safely to the eggs!<br><br>The Bad Piggies are after the eggs again -- but as usual, nothing is going according to plan! Can you create the ultimate flying machine and steer them safely to their destination? Those tricky pigs have a few objects they can use, but they need your help to turn these into the perfect transportation!<br><br>With more than 200 levels, and free updates coming up, you have hours and hours of pig-crashing, exploding, and flying fun! Get three stars to unlock over 40 more levels! HINT: Sometimes you need to play the level several times to achieve all the objectives -- try building a new device or steering in a different way to earn all the stars!<br><br>Features:<br>● Over 200 levels crammed with flying/driving/crashing fun!<br>● 40+ special levels unlocked by getting three stars!<br>● Free updates!<br>● 9+ sandbox levels to stretch your creativity!<br>● Ultra-special, ultra-secret, ultra-difficult sandbox level to unlock by collecting ten skulls! Oh – guess it’s not a secret anymore...<br>● 42 objects to create the ultimate machine: motors, wings, fans, bottle rockets, umbrellas, balloons, and much more!<br><br>Mechanic Pig<br>● Need help? This little piggy will build it for you!<br>● Mechanic pig pre-assembles transport for you!<br>● All you have to do is pilot it!<br>● Tweak his design to get all three stars!<br><br>Get ready to see pigs fly!<br><br>Become a fan of Bad Piggies on Facebook:<br>http://facebook.com/badpiggies<br><br>Follow us on Twitter:<br>http://twitter.com/badpiggies<br><br>Terms of Use: http://www.rovio.com/terms-of-service<br>Privacy Policy: http://www.rovio.com/privacy<br><br><br>Important Message for Parents<br><br>This game may include:<br>- Direct links to social networking websites that are intended for an audience over the age of 13.<br>- Direct links to the internet that can take players away from the game with the potential to browse any web page.<br>- Advertising of Rovio products and also products from select partners.<br>- The option to make in-app purchases. The bill payer should always be consulted beforehand.",
